import React, { Component } from "react";

class IndexIntroText extends Component {
  state = {};
  render() {
    return (
      <div id="textWrapper">
        <div id="header">Welcome to Receiply</div>
        <div id="subtitle">Family recipe sharing made easy</div>
      </div>
    );
  }
}

export default IndexIntroText;
